+ (id)defaultManager{
    static ConnectionManager *connectionManager;
    static dispatch_once_t onceToken;
    dispatch_once(&onceToken, ^{
        connectionManager = [[ConnectionManager alloc] init];
        [[NSNotificationCenter defaultCenter] addObserver:connectionManager
                                                 selector:@selector(reachabilityChanged:)
                                                     name:kReachabilityChangedNotification
                                                   object:nil];
        [connectionManager setReachability:[Reachability reachabilityForInternetConnection]];
       // [[Settings sharedInstance] setIsReachable:!connectionManager.reachability.connectionRequired];
        [connectionManager.reachability startNotifier];
        
        if(![connectionManager isReachable])
            
            [ConsoleLogHandler showLog:@"FieldTekPro can't connect to the internet. Please check your connection and try again."];
    });
    return connectionManager;
}

- (id)init{
    self = [super init];
    if(self){
        self.activeConnectionRequestQueue = [[NSMutableArray alloc] init];
        self.pendingConnectionRequestQueue = [[NSMutableArray alloc] init];
        self.offlineConnectionRequestQueue = [[NSMutableArray alloc] init];
        
        defaults = [NSUserDefaults standardUserDefaults];
    }
    return self;
}

#pragma mark -

- (void)addConnectionwithDetail:(NSMutableArray *)detailArray prioriy:(connectionPriority)priorityValue delegate:(id)parentDelegate
{
    switch (priorityValue) {
        case HIGH:
            if (self.activeConnectionRequestQueue.count) {
                [Request stopRequest];
                [self.activeConnectionRequestQueue removeAllObjects];
                [self.pendingConnectionRequestQueue insertObject:detailArray atIndex:0];
            }
            break;
         case MEDIUM:
            [self.pendingConnectionRequestQueue addObject:detailArray];
            break;
        default:
            break;
    }
}

- (void)stopCurrentConnetion
{
    [Request stopRequest];
    [self.activeConnectionRequestQueue removeAllObjects];
    [self.pendingConnectionRequestQueue removeAllObjects];
}

- (void)startNextConnection
{
    if ([self.pendingConnectionRequestQueue count]) {
        if ([self.activeConnectionRequestQueue count]) {
            [self.pendingConnectionRequestQueue removeObjectAtIndex:0];
        }
        [self.activeConnectionRequestQueue removeAllObjects];
        if([self.pendingConnectionRequestQueue count])
        {
            [self.activeConnectionRequestQueue addObjectsFromArray:[self.pendingConnectionRequestQueue firstObject]];
            [self startConnection];
            return;
        }
        else
        {
            [self refreshSyncLog];
        }
    }
    else
    {
        [self refreshSyncLog];
    }
}

- (void)startConnection
{
    NSString *key = @"";
    NSString *str_UserNameDep = [[NSUserDefaults standardUserDefaults] objectForKey:@"userName"];
    decryptedUserName = [str_UserNameDep AES128DecryptWithKey:key];
    if ([self.activeConnectionRequestQueue count]) {
        
        if ([[self.activeConnectionRequestQueue objectAtIndex:2] isEqualToString:@"Notification"] && ([[self.activeConnectionRequestQueue objectAtIndex:6] isEqualToString:@"ERROR"] || [[self.activeConnectionRequestQueue objectAtIndex:6] isEqualToString:@"New"])){
            if ([[self.activeConnectionRequestQueue objectAtIndex:3] isEqualToString:@"Create"]) {
                
