-(void)refreshSyncLogButtonPressed{
    
    if (![self.pendingConnectionRequestQueue count]) {
        [self.pendingConnectionRequestQueue addObjectsFromArray:[[DataBase sharedInstance] getAllPendingSyncLogs]];
        if ([self.pendingConnectionRequestQueue count]) {
            [self startNextConnection];
        }
        else{
            
        }
    }
}

- (void)refreshSyncLog
{
    if (![self.pendingConnectionRequestQueue count]) {
        [self.pendingConnectionRequestQueue addObjectsFromArray:[[DataBase sharedInstance] getAllPendingSyncLogs]];
        if ([self.pendingConnectionRequestQueue count]) {
            [self startNextConnection];
        }
        else{
             [self stopCurrentConnetion];
         }
    }
    else
    {
        [self startConnection];
 
    }
    
}

- (BOOL)canStartNextConnection
{
    if ([self.pendingConnectionRequestQueue count]) {
        return YES;
    }
    return NO;
}

- (BOOL)isConnectionQueueIsActive
{
    if ([self.activeConnectionRequestQueue count]) {
        return YES;
    }
    return NO;
}

