- (BOOL)isReachable{
    
    return ([self.reachability currentReachabilityStatus] != NotReachable);
}

#pragma mark - download delegates
- (void)processLevel:(NSArray *)processDetails
{
    if ([[processDetails lastObject] isKindOfClass:[NSNumber class]]) {
        float percentage = [[processDetails lastObject] floatValue];
        if (percentage < 100.0) {
            [downloadStatusDictionary setObject:[NSString stringWithFormat:@"%i",[[processDetails lastObject] intValue]] forKey:[processDetails firstObject]];
        }
        else if (percentage == 100.0)
        {
            [downloadStatusDictionary removeObjectForKey:[processDetails firstObject]];
        }
    }
    else
    {
        [downloadStatusDictionary setObject:[NSString stringWithString:[processDetails lastObject]] forKey:[processDetails firstObject]];
    }
    
}

